import React from 'react';

function ContactSlip() {
// 151C29,647692,4199E0,4CB1F3

    const contactSlipCont = {
        background: '#4199E0',
        color: '#eee',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',


        padding: '30px',
    }

    const leftBlock = {
        // backgroundColor: 'red',
        width: '50%',
        height: '300px',
        borderRight: '2px solid #151C29'
    }

    const rightBlock = {
        // backgroundColor: 'green',
        width: '50%',
        height: '300px',
    }

  return (
    <div className="contactSlip" style={ contactSlipCont }>
        <div style={ leftBlock }>
            Contact Us Today!
        </div>
        <div style={ rightBlock }>
            Hello
        </div>
    </div>
  );
}

export default ContactSlip;
